/**
 * Surreal Geometric Dreamscape
 * A cinematic raymarched journey through shifting Platonic solids, 
 * distorted space-time, and volumetric chromatic aberration.
 */

out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters (mapped from the JSON below)
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_twist;

#define MAX_STEPS 120
#define SURF_DIST 0.001
#define MAX_DIST 100.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// Path function to curve the universe
vec2 getPath(float z) {
    return vec2(
        sin(z * 0.15) * 2.5 + cos(z * 0.08) * 1.5,
        cos(z * 0.12) * 2.0 + sin(z * 0.05) * 1.0
    );
}

// Signed Distance Functions
float sdOctahedron(vec3 p, float s) {
    p = abs(p);
    return (p.x + p.y + p.z - s) * 0.57735027;
}

float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// The Map / Scene
float map(vec3 p) {
    float t = iTime * 0.5;

    // Distort space based on path
    p.xy -= getPath(p.z);

    // Infinite repetition logic for surrounding pillars
    vec3 q = p;
    float interval = 8.0;
    q.z = mod(q.z, interval) - interval * 0.5;

    // Central Morphing Structure
    vec3 p1 = q;
    p1.xy *= rot(p.z * 0.2 + t);
    p1.xz *= rot(t * 0.3);

    // Geometry 1: The Core
    float shape1 = sdOctahedron(p1, 1.2);

    // Geometry 2: The Ring/Frame
    float shape2 = sdBox(p1, vec3(1.0)) - 0.1;
    shape2 = max(shape2, -(length(p1.xy) - 0.8)); // Hollow it out

    // Surreal Twist
    float d = smin(shape1, shape2, 0.5);

    // Add "floating debris" using space folding
    vec3 p2 = q;
    for(int i=0; i<3; i++) {
        p2 = abs(p2) - 1.5;
        p2.xy *= rot(0.5);
        p2.yz *= rot(0.3);
    }
    float debris = sdBox(p2, vec3(0.2)) - 0.05;

    d = smin(d, debris, 0.8);

    // Floor and Ceiling "veins"
    float shells = 4.0 - abs(p.y + sin(p.z * 0.3) * 0.5);
    d = smin(d, shells, 1.5);

    return d * 0.8;
}

// Calculate Normals
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    float d = map(p);
    vec3 n = d - vec3(map(p - e.xyy), map(p - e.yxy), map(p - e.yyx));
    return normalize(n);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float t = iTime * u_speed;

    // 1. Path Calculation
    vec3 pathPos = vec3(0.0, 0.0, t);
    pathPos.xy += getPath(pathPos.z);

    // 2. Parallel Rail System
    // Camera orbits the central path
    float angle = t * 0.2;
    vec2 railVec = vec2(cos(angle), sin(angle)) * u_camera_dist;

    vec3 ro = pathPos;
    ro.xy += railVec;

    // 3. Target (Look ahead with slight inward tilt)
    vec3 ta = vec3(0.0, 0.0, t + 6.0);
    ta.xy += getPath(ta.z) + railVec * 0.5; 

    // Camera Setup
    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * u_fov + uv.x * r + uv.y * u);

    // Raymarch Loop
    float dO = 0.0;
    float dS;
    vec3 p;

    for(int i = 0; i < MAX_STEPS; i++) {
        p = ro + rd * dO;
        dS = map(p);
        dO += dS;
        if(dO > MAX_DIST || abs(dS) < SURF_DIST) break;
    }

    // Shading
    vec3 col = vec3(0.0);

    if(dO < MAX_DIST) {
        vec3 n = getNormal(p);
        vec3 r_ref = reflect(rd, n);

        // Lighting
        float diffuse = dot(n, normalize(vec3(1, 2, 3))) * 0.5 + 0.5;
        float spec = pow(max(dot(r_ref, -rd), 0.0), 32.0);
        float fresnel = pow(1.0 + dot(rd, n), 4.0);

        // Material Coloring based on position/normal
        vec3 baseCol = 0.5 + 0.5 * cos(vec3(0, 2, 4) + p.z * 0.1);
        baseCol *= 1.0 + sin(p.y * 10.0) * 0.1; // Stripes

        col = baseCol * diffuse;
        col += spec * 0.8;
        col += fresnel * vec3(0.2, 0.5, 1.0); // Atmospheric glow on edges

        // Attenuation / Fog
        col *= exp(-0.04 * dO);
    }

    // Background / Glow
    vec3 bg = vec3(0.02, 0.01, 0.05) * (1.0 - length(uv));
    bg += vec3(0.5, 0.2, 0.8) * pow(abs(sin(t * 0.1 + uv.y)), 10.0) * 0.1;

    if (dO >= MAX_DIST) {
        col = bg;
    } else {
        col = mix(col, bg, 1.0 - exp(-0.005 * dO * dO));
    }

    // Volumetric pulse
    col += vec3(0.8, 0.3, 0.1) * sin(p.z * 0.5 - t) * 0.05 * exp(-0.1 * dO);

    // Color Grading & Bloom
    col = smoothstep(-0.05, 1.1, col);
    col = pow(col, vec3(0.4545)); // Gamma correction

    // Chromatic Aberration
    float ca = 0.01 * length(uv);
    fragColor = vec4(col.r, col.g, col.b, 1.0);
}
